57سینٹیگریڈ کی قیامت خیز گرمی میں شہر میں14گھنٹے بجلی غیر موجود ہونے سے لوگ مشکلات کا شکار ہیں جس کہ باعث معتدد افراد کی زندگی خطرے میں ہے۔۔افسوس یہ وہ شہر ہے جہاں سے پاکستان کہ دو وزیراعظم منتخب ہوئے، اس شہر میں بجلی کا شدید بحران ہے
